import React from 'react'
import ReactDom from 'react-dom'
import Card from './Cards'
import Sdata from './Sdata'
ReactDom.render(
  <> 
  <h1>List of top 5 in 2022</h1>
  <Card 
    imgsrc={Sdata[0].imgsrc}
    title={Sdata[0].title}
    sname={Sdata[0].sname}
    link={Sdata[0].link}
  />
  </>
  ,
  document.getElementById('root')
);
